import "./App.css";
import { useState } from "react";

function App() {
  const [name, setName] = useState("");
  const [lastName, setLastName] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [age, setAge] = useState("");
  const [country, setCountry] = useState("");

  return (
    <div className="container-fluid h-100">
      <div className="row h-100 mx-4">
        <div className="col d-flex flex-column p-0">
          <main className="h-100 d-flex flex-column justify-content-center align-items-center">
            <h3 className="h3 mt-4 p-3">
              <span className="text-white"> Sign Up </span>
            </h3>

            <div className="sign-up">
              <form>
                <div className="row mt-3 mb-3">
                  <div className="col h6">
                    <label htmlFor="Name">First Name</label>
                    <input
                      type="text"
                      className="form-control form-control-sm"
                      id="Name"
                      aria-label="Name"
                      onChange={(event) => {
                        setName(event.target.value);
                      }}
                    />
                  </div>
                  <div className="col h6">
                    <label htmlFor="lurname">Last Name</label>
                    <input
                      type="text"
                      className="form-control form-control-sm"
                      id="lastName"
                      aria-label="lastName"
                      onChange={(event) => {
                        setLastName(event.target.value);
                      }}
                    />
                  </div>
                </div>

                <div className="mb-3 h6">
                  <label htmlFor="username" className="form-label">
                    Username
                  </label>
                  <input
                    type="text"
                    className="form-control form-control-sm"
                    id="username"
                    aria-describedby="username"
                    onChange={(event) => {
                      setUsername(event.target.value);
                    }}
                  />
                </div>

                <div className="mb-3 h6">
                  <label htmlFor="email" className="form-label">
                    Email Address
                  </label>
                  <input
                    type="email"
                    className="form-control form-control-sm"
                    id="email"
                    aria-describedby="emailHelp"
                    onChange={(event) => {
                      setEmail(event.target.value);
                    }}
                  />
                </div>

                <div className="row mt-3 mb-3">
                  <div className="col h6">
                    <label htmlFor="age">Age</label>
                    <select
                      className="form-select form-select-sm"
                      aria-label="age select"
                      onChange={(event) => {
                        setAge(event.target.value);
                      }}
                    >
                      <option value="">--select--</option>
                      <option value="USA">United States of America</option>
                      <option value="Other">Other</option>
                    </select>
                  </div>

                  <div className="col h6">
                    <label htmlFor="country">Country</label>
                    <select
                      className="form-select form-select-sm"
                      aria-label="Default select example"
                      onChange={(event) => {
                        setCountry(event.target.value);
                      }}
                    >
                      <option value="">--select--</option>
                      <option value="USA">United States of America</option>
                      <option value="Other">Other</option>
                    </select>
                  </div>
                </div>

                <div className="mb-3 h6">
                  <label htmlFor="password" className="form-label">
                    Password
                  </label>
                  <input
                    type="text"
                    className="form-control form-control-sm"
                    id="password"
                    aria-describedby="passwordHelp"
                    onChange={(event) => {
                      setPassword(event.target.value);
                    }}
                  />
                </div>

                <div className="mb-3 h6">
                  <label htmlFor="confirmpassword" className="form-label">
                    Confirm password
                  </label>
                  <input
                    type="text"
                    className="form-control form-control-sm"
                    id="confirmpassword"
                    aria-describedby="confirmpasswordHelp"
                    onChange={(event) => {
                      setConfirmPassword(event.target.value);
                    }}
                  />
                </div>

                <div>
                  <div className="error-message">{signuperror}</div>

                  <button
                    type="submit"
                    className="buttn"
                    disabled={
                      !email ||
                      !password ||
                      !confirmPassword ||
                      !userName ||
                      !name ||
                      !surname ||
                      !country
                    }
                    onClick={signuppage}
                  >
                    {" "}
                    Sign Up
                  </button>
                </div>
              </form>
            </div>
          </main>
        </div>
      </div>
    </div>
  );
}

export default App;

